public Node getNotSmaller(final T reference){
    Node candidate = null;
    for (Node node = top; node != null; ) {
        if (node.element.compareTo(reference) < 0) {
            if (node.right == null) {
                return candidate;
            }
            node = node.right;
        } else {
            candidate = node;
            if (node.left == null) {
                return candidate;
            }
            node = node.left;
        }
    }
    return null;
}

