private static int computeMSB(final long l){
    long ll = l;
    long mask = 0xffffffffL;
    int scale = 32;
    int msb = 0;
    while (scale != 0) {
        if ((ll & mask) != ll) {
            msb |= scale;
            ll >>= scale;
        }
        scale >>= 1;
        mask >>= scale;
    }
    return msb;
}

